VINCULOS.OUTRAS-INFORMACOES:
Prestação de serviço especializado em Teste e Qualidade de Software:
- Estabelecimento e implantação do processo de teste na empresa;
- Ajuste e aplicação do processo de teste com a dinâmica do SCRUM adotado pela empresa;
- Identificação e especificação de artefatos como Planos de Teste, Cenários de Teste e Casos de Teste dentro do escopo programado para cada produto ou projeto desenvolvido;
- Planejamento do ambiente de teste;
- Melhorias no processo de implantação (deploy) da empresa;
- Automação dos testes de unidade, de sistema e de performance, bem como testes de regressão, por meio de frameworks como: JUnit (JMock, EasyMock, Mockito, PowerMock), JMeter, Selenium e recursos desenvolvidos internamente usando tecnologia Java, conforme necessidade;
- Automação de rotinas no ambiente de teste como auxílio de ShellScript (Linux/Unix).
